import React from "react";
import "./Blog.css";

function MbbsSeatsIndia() {
  return (
		<div>
			<div className="service__bg">
				<h1 className="service__title">2020 Mbbs Fee Structure In India And Abroad</h1>
			</div>
			<img src="/assets/images/blog-banners/mbbs-fee-structure-in-india-abroad.png" alt="2020 Mbbs Fee Structure In India And Abroad" />
		</div>
	);
}

export default MbbsSeatsIndia;
